import { Form, Formik } from 'formik'
import React from 'react'
import FormikInput from './Formik/FormikInput'

const Login = () => {
  
  return (
    <Formik>
      {(formik) => {
        return (
          <Form>
            <FormikInput
              label="email"
              id="email"
              type="email"
              name="email"
              required={true}
              onChange={(e) => {}}

            ></FormikInput>
          </Form>
        )
      }}

    </Formik>
  )
}

export default Login
